-- Criar tabela de vitaminas 
DROP TABLE IF EXISTS info_nutri_vita;
CREATE TABLE info_nutri_vita (
    id_alimento int  NOT NULL,
    descricao varchar(255),
    energia_kcal int,
    proteina_g varchar(10),
    lipideos_g varchar(10),
    colesterol_mg varchar(10),
    carboidrato_g varchar(10),
    fibra_g varchar(10),
    cinzas_g varchar(10),
    calcio_mg varchar(10),
    magnesio_mg varchar(10),
    manganes_mg varchar(10),
    fosforo_mg varchar(10),
    ferro_mg varchar(10),
    sodio_mg varchar(10),
    potassio_mg varchar(10),
    cobre_mg varchar(10),
    zinco_mg varchar(10),
    retinol_mcg varchar(10),
    re_mcg varchar(10),
    rae_mcg varchar(10),
    tiamina_mg varchar(10),
    riboflavina_mg varchar(10),
    piridoxina_mg varchar(10),
    niacina_mg varchar(10),
    vitamina_c_mg varchar(10),
    PRIMARY KEY(id_alimento)
);






