-- Criar tabela de gorduras 
DROP TABLE IF EXISTS info_nutri_gord;
CREATE TABLE info_nutri_gord (
id_alimento int NOT NULL,
saturados_g varchar(10),
monoinsaturados_g varchar(10),
poliinsaturados_g varchar(10),
FOREIGN KEY (id_alimento)
REFERENCES info_nutri_vita(id_alimento),
PRIMARY KEY(id_alimento)
);

